import React from "react";
import {
  Wrap,
  FlexTitle,
  Title,
  FlexBig,
  FlexMain,

  FlexText,

} from "../styles/About";
// import Fade from "react-reveal/Fade";

function Projects() {
  return (
    <Wrap>
      <div className="container">
        <Title id="Projects">Projects</Title>

          <FlexText >
            <FlexTitle>DIVERSITY</FlexTitle>
            <FlexMain>
              <FlexBig>Gender progressive</FlexBig>
              <p>
                Struggling to attract female seniors and leaders into your
                recruitment process? Dedicated gender neutral sourcing
                strategies to attract a more diverse talent pool.
              </p>
            </FlexMain>
          </FlexText>

      </div>
    </Wrap>
  );
}

export default Projects;
